import { Link } from 'react-router-dom'

export default function Performances() {
    return (
        <div className="p-4 text-white">
            <h2 className="text-2xl font-bold">Sounding Images & Percussion </h2>
            <p>Performance from </p>
            <Link to="https://genbib.dk/tranen">Tranen, Gentofte Hovedbibliotek</Link>
            <p>, march 31, 2019. I am performing on an iPad, showcasing my IOS app Sounding Images #7-12 in an improvisatory interplay with Ying-Hsueh Chen on her acoustic percussion instruments. We perform regularly with this setup at various venues.</p>
            <iframe 
                width="420" 
                height="345" 
                src="https://www.youtube.com/embed/Ehx0cWi_bbY?si=x9CmG4wnzqygTSOH" 
                //src={"https://www.youtube.com/embed/Ffe-7T6yDhU"} 
                title="Artwork Video"
                //className="block" 
            ></iframe>
        </div>
    );
}
